import React from 'react';
import ExecutiveBoard from './Components/Tabs/About/ExecutiveBoard';
import {Route } from 'react-router-dom';
import {BrowserRouter as Router} from 'react-router-dom';


function About() {
    return (
      <div>
        <Header/>
        <Router>
        <NavigationBar />

          <Route
            path="/home"
            exact
            render={() => 
            <div>home</div>}
          />

          <Route
            path="/about"
            exact
            render={() => 
            <ExecutiveBoard/>}
          />

          <Route
            path="/events"
            exact
            render={() => 
            <div>events</div>}
          />

            <Route
            path="/contact"
            exact
            render={() => 
            <div>contact</div>}
          />



            <Route
            path="/studentResources"
            exact
            render={() => 
            <div>resources</div>}
          />

            <Route
            path="/partnerWithPratt"
            exact
            render={() => 
            <div>partner</div>}
          />


        </Router>
      </div>
    );
  }

  export default About;
